import Form from 'react-bootstrap/Form';
import USD from '../../imgs/images.png'
import EUR from '../../imgs/eur.png'
import UAH from '../../imgs/uah.png'
import './select.css'


function Select() {
    return (
        <Form.Select aria-label="Default select example">
            <option>Currency</option>
            <option value="1"><img src={USD} className={'flag'}/></option>
            <div>dffd</div>
            <option value="2">
                <div style={{backgroundColor: 'red'}}><img src={EUR} className={'flag'}/></div>
            </option>
            <option value="3"><img src={UAH} className={'flag'}/></option>
        </Form.Select>
    );
}

export default Select;
